Yes, i went back to school today, and it was no fun. 1. i was really tired. 2. since i was tired, i didn't say much today, then people decide not to talk to you just because you aren't talking....LAMEEE!!!! 3. Twas raining.
4. bad lunch 5. failing chem!!!!

Now it's sunny, and i'm doing pretty good. Going to a blazers game tonight with Brendan, and we have box seats. If we didn't have box seats, i have to admit, i really wouldn't want to go. The blazers aren't that great. They are probably going to lose, so we are going to go watch them lose....IN COMFORT! &hearts;
Plus, i just enjoy being with Brendan, he makes everything great! &hearts;
